import React, { useState } from "react";

export default () => {
  return (
    <form class="ui form">
      <div class="field">
        <label>First Name</label>
        <input type="text" name="first-name" placeholder="First Name" />
      </div>
      <button class="ui button" type="submit">
        Submit
      </button>
    </form>
  );
};
